import React, { Component } from 'react';

class Boton extends Component {

  constructor (props){
    super(props);
     this.state = {
      texto: '',
    };
     console.log("soy constructor");
    };

  render() {

    return (

              <button>{this.props.texto}</button>
    );
  }
 }

export default Boton;
